const ShoesCard = ({shoe}) => {
    console.log(shoe)
    return (
        <li key={shoe.id}>
            <Link to=""></Link>
            {shoe.brand} <br/>
            {shoe.model} <br/>
            {shoe.price} <br/>
            {shoe.ratin}
        </li>
    )
}


export default ShoesCard;
